import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    const movies = [
      { id: 0, title: "movie1", overview: "first overview" },
      { id: 1, title: "movie2", overview: "second overview" }
    ];

    this.state = {
      rows: [
        <p key="1">This is my row</p>,
        <p key="2">This is my row</p>,
        <p key="3">This is my row</p>
      ]
    };

    let movieRows = movies.map(movie => {
      const movieRow = (
        <table>
          <tbody>
            <tr>
              <td>
                <img src="" />
              </td>
              <td>{movie.title}</td>
            </tr>
          </tbody>
        </table>
      );
      return <p key={movie.id}>{movie.title}</p>;
    });

    this.state = { rows: movieRows };
  }

  render() {
    return (
      <div>
        <table className="titleBar">
          <tbody>
            <tr>
              <td>
                <img width="50" height="50" src="./search.svg" alt="" />
              </td>
              <td width="10" />
              <td>
                <h1>Movie Digger - The MoviesDB Search</h1>
              </td>
            </tr>
          </tbody>
        </table>

        <input className="searchBar" placeholder="Enter movie name" />

        {this.state.rows}
      </div>
    );
  }
}

export default App;
